import "./styles.css";

const Pokemon = (img, name, type, height, weight) => {
  return (
    <div className="card">
      <div className="image-container">
        <img src={img} alt="Pokemon" />
      </div>

      <h3 className="name">{name}</h3>
      <h5 className="type">Type: {type}</h5>
      <h5 className="height">Height: {height}</h5>
      <h5 className="weight">Weight: {weight}</h5>
    </div>
  );
};

export default Pokemon;
